"use strict";(self.webpackChunkdocs=self.webpackChunkdocs||[]).push([[1477],{30010:e=>{e.exports=JSON.parse('{"blogPosts":[{"id":"release-notes-annotate-detected-elements","metadata":{"permalink":"/blog/release-notes-annotate-detected-elements","source":"@site/blog/2023-12-13/annotate-detected-elements.md","title":"2023.12.13 Annotate DetectedElements from get()","description":"Overview","date":"2023-12-13T00:00:00.000Z","formattedDate":"December 13, 2023","tags":[{"label":"ReleaseNotes","permalink":"/blog/tags/release-notes"}],"readingTime":0.655,"hasTruncateMarker":true,"authors":[{"name":"Leon Meier","title":"Head of Product","email":"leon.meier@askui.com","imageURL":"/img/leonmeier.jpeg","key":"leonmeier"},{"name":"Johannes Dienst","title":"Developer Advocate","email":"johannes.dienst@askui.com","imageURL":"/img/johannesdienst.jpeg","key":"johannesdienst"}],"frontMatter":{"title":"2023.12.13 Annotate DetectedElements from get()","slug":"release-notes-annotate-detected-elements","authors":["leonmeier","johannesdienst"],"tags":["ReleaseNotes"],"hide_table_of_contents":false},"unlisted":false},"content":"## Overview\\n\\nThis update introduces an optional `AnnotationRequest` parameter to the `annotate()` method, allowing users to annotate specific elements retrieved from user interfaces by the `get()` method.\\n\\n## Benefits\\n\\n- Users can now annotate elements fetched by `get()`, enhancing visibility and interaction with these elements.\\n- Simplifies UI element selection debugging with targeted annotations.\\n\\n\x3c!-- truncate --\x3e\\n\\n## How to Use\\n\\n1. Use the `get()` method to retrieve elements.\\n2. Pass the `AnnotationRequest` parameter to specify which elements to annotate.\\n3. Execute the annotation command as shown in the provided example.\\n\\n## Example\\n\\n```typescript\\nconst detectedElements = await aui.get().text().withText(\\"User Interfaces?\\").exec();\\nawait aui.annotate({ elements: detectedElements });\\n```\\n\\n_Result: Annotated bounding box around the text \\"User Interfaces?\\" on askui.com._\\n\\n![Screenshot of askui.com website with a bounding box around the detected element User Interfaces?](annotate_with_detected_elements.png)"}]}')}}]);